import React from "react";
import Naviguation from "./components/naviguation/main";

function Layout({ children }) {
  return (
    <div>
      <div>
        <Naviguation />
      </div>
      {children}
      <footer> Footer </footer>
    </div>
  );
}

export default Layout;
